import React, { useState } from 'react'
import { Text, View, StyleSheet, ImageBackground,Image,TouchableOpacity, Switch ,TextInput,SafeAreaView  } from "react-native"
import * as Animatable from 'react-native-animatable';
import firebase from 'firebase/app';
import "firebase/auth";

export default function LoginScreen({ navigation }) {
    const [number] = React.useState(null);

    function replica(){
      
    }


    const styles = StyleSheet.create({
        text: {
          top:"100%",  
          height: 40,
          margin: 12,
          
          padding: 10,
        },
        input: {
          top:"105%",  
          height: 40,
          margin: 12,
          borderWidth: 1,
          padding: 10,
        },
      
        enter:{
          top:"290%",  
          height: 40,
          width:80,
          borderRadius:10,
          margin: 12,
          borderWidth: 1,
          padding: 10,
          backgroundColor:"blue",
          
        }
      });



 
    return (

        <View>
            <Text style={styles.text}>PISOS</Text>
            <TextInput
                style={styles.input}
                placeholder="Ingrese numero"
                keyboardType="numeric"
                value={number}
            />
            <TouchableOpacity  onPress={() => replica()}>
                <Text style={styles.enter}>Enter</Text>
            </TouchableOpacity>
            <Text>
                {number}
            </Text>
        
        </View>
    )
}
